threshold = 0.5

def preprocess(lst, option):

    ret = []
    for l in lst:
        idtup = l[0]
        original_label = l[1][0]
        seq0 = math.exp(l[2][0])/(math.exp(l[2][0])+ math.exp(l[2][1]))
        seq1 = math.exp(l[3][0])/(math.exp(l[3][0])+ math.exp(l[3][1]))
        seq2 = math.exp(l[4][0])/(math.exp(l[4][0])+ math.exp(l[4][1]))
        seq3 = math.exp(l[5][0])/(math.exp(l[5][0])+ math.exp(l[5][1]))
        seq4 = math.exp(l[6][0])/(math.exp(l[6][0])+ math.exp(l[6][1]))

        seq = [seq0, seq1, seq2, seq3, seq4]
        if option=='no_response':
            checkNoRes = sum([1 if elem > threshold else 0 for elem in seq])
            if checkNoRes < 1:
                ret.append([idtup, original_label, seq])

        if option=='false_composition':
            checkSepa = sum([1 if elem > threshold else 0 for elem in seq[:1]])
            checkComp = sum([1 if elem > threshold else 0 for elem in seq[1:]])
            if original_label == 0 and checkSepa < 1 and checkComp > 0:
                ret.append([idtup, original_label, seq])

        if option=='false_separation':
            checkSepa = sum([1 if elem > threshold else 0 for elem in seq[:1]])
            checkComp = sum([1 if elem > threshold else 0 for elem in seq[1:]])
            if original_label > 0 and checkSepa > 0 and checkComp < 1:
                ret.append([idtup, original_label, seq])

        if option=='strictly_all_positive':
            checkAllPos = sum([1 if elem > threshold else 0 for elem in seq])
            if checkAllPos == 5:
                ret.append([idtup, original_label, seq])
        
        if option=='roughly_all_positive':
            checkSepPos = 1 if seq[0] > threshold else 0
            checkComPos = sum([1 if elem > threshold else 0 for elem in seq[1:]])
            checkAllPos = sum([1 if elem > threshold else 0 for elem in seq])
            if checkSepPos == 1 and checkComPos > 0 and checkAllPos != 5:
                ret.append([idtup, original_label, seq])

        if option=='true_separation':
            checkSepa = sum([1 if elem > threshold else 0 for elem in seq[:1]])
            checkComp = sum([1 if elem > threshold else 0 for elem in seq[1:]])
            if original_label > 0 and checkSepa == 0 and checkComp > 0:
                ret.append([idtup, original_label, seq])
            

    print('under ', option, ', ', len(ret), ' cases retrieved!' )

    return ret



