def find_interest(lst, rows):
    ret = []
    for l in lst:
        for r in rows:
            if l[0][0]==r[9] and l[0][1]==r[10]:
                ret.append(r)
    return ret

def read_coords(fn):
    orderdata = []
    f = open(fn)
    csvReader = csv.reader(f)

    cnt = 0
    for row in csvReader:
        
        xy = []
        xy.append(float(row[0]))
        xy.append(float(row[1]))
        xy.append(float(row[2]))
        xy.append(float(row[3]))
        xy.append(float(row[4]))
        xy.append(float(row[5]))
        xy.append(float(row[6]))
        xy.append(float(row[7]))
        xy.append(int(row[8]))
        xy.append(str(row[9]))
        xy.append(str(row[10]))

        orderdata.append(xy)


    return orderdata


coord_xy = read_coords('coord_xy.csv')

con = genImage.getConfigFromList([config.MIN_LONG, config.MAX_LONG, config.MIN_LAT, config.MAX_LAT, config.GRAY_SCALE, config.STEP])
gm = genImage.draw_map(coord_xy,con)


opt = 'true_separation' # 'no_response', 'strictly_all_positive', 'roughly_all_positive', 'false_composition', 'false_separation'
z= preprocess(lst, opt)
zz = find_interest(z, coord_xy)
rgb_x, y, ids = genImage.xy_to_rgbArray(zz, gm, con, gen_all=True)


it = len(ids)//5
if not os.path.exists("./checking/%s"%opt):
    os.makedirs("./checking/%s"%opt)

for i in range(it):
    xs = rgb_x[i*5:i*5+5]
    ys = y[i*5:i*5+5]
    
    titleStr = '%s,%s\nCASE:%s'%(ids[i*5][0],ids[i*5][1],opt)
    nameStr = '%s_%s.png'%(ids[i*5][0],ids[i*5][1])
    plt.suptitle(titleStr)

    for j in range(5):
        ax = plt.subplot(1,5,j+1)
        x_th = np.reshape(xs[j], (32,32,3))
        info = z[i]
        labelFontColor = 'r'
        if ys[j][0] == 1:
            labelFontColor = 'g'
        predFontColor = 'r'
        if info[2][j] > threshold:
            predFontColor = 'g'
        ax.set_title('LABEL:%d' % ys[j][0], color=labelFontColor)
        ax.set_xlabel('PRED: %.3f'%info[2][j], color=predFontColor)
        ax.set_yticklabels([])
        ax.set_xticklabels([])
        ax.set_yticks([])
        ax.set_xticks([])
        ax.imshow(x_th)

    plt.savefig("./checking/%s/%s"%(opt, nameStr))